import React from "react";
const PrintName =() =>{
    return<h1>our company</h1>;
};
function VeeraName(){
    return<PrintName/>;
};
function AppName() {
    const user = {
        firstName:"sage",
        secondName:"it",
    };
  return ( 
  <section>
    <h1>hello{new Date().toLocaleTimeString()}</h1>
    <p>this is our company{user.firstName+" "+user.secondName}</p>
    <VeeraName/>
    </section>
  );
};
    
    
export default AppName;
